  //       console.log(res);
  //       console.log(res.data);
  //       setOutfits(res.data);
  //     })
  //     .catch((err) => console.log(err));
  // }

  function handleOutfits(event) {
    console.log(event.target);

  }

  return (
    <>
      <Header />
      <div className="topButtons">
        <ReusableBtn
          to="/item"
          className="newItemBtn btn btn-outline-secondary"
        >
          Add New Item
        </ReusableBtn>
        <ReusableBtn
          to="/buildoutfit"
          className="buildoutfitBtn btn btn-outline-secondary"
        >
          Build Outfit
        </ReusableBtn>
      </div>

      <ListContainer style={{ display: "flex" }}>
        <UnorderedList className="ulElement" onClick={handleOutfits}>
          Spring
          <ListElement className="liElement">
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
          </ListElement>
        </UnorderedList>

        <UnorderedList className="ulElement" onClick={handleOutfits}>
          Summer
          <ListElement>
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
          </ListElement>
        </UnorderedList>

        <UnorderedList className="ulElement" onClick={handleOutfits}>
          Fall
          <ListElement>
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
          </ListElement>
        </UnorderedList>

        <UnorderedList className="ulElement" onClick={handleOutfits}>
          Winter
          <ListElement>
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
            <ImgTag src={TemplateImage} className="imgElement" />
          </ListElement>
        </UnorderedList>
      </ListContainer>

      <ListContainer >"outfits will be display here"
        <ListElement>
          <ImgTag src="" className="diplayOutfits"/>
        </ListElement>
      </ListContainer>
{/* {books.length ? (
              <List>
                {books.map(book => (
                  <ListItem key={book._id}>
